        vertical-align: middle;
        touch-action: manipulation;
        cursor: pointer;
        background-image: none;
        border: 1px solid transparent;
        white-space: nowrap;
        padding: 6px 12px;
        font-size: 14px;
        line-height: 1.42857;
        border-radius: 4px;
        -webkit-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;
        user-select: none;
      }

      .btn {
        border-radius: 0;
        border: none;
        font-weight: 700;
        font-size: 1.5rem;
        padding: 10px 0;
        text-decoration: none
      }

      .btn-default {
        padding: 20px 30px;
        background: #232323;
        color: #fff;
        text-decoration: none;
        position: relative;
        -webkit-transform: translate3d(0, 0, 0);
        -moz-transform: translate3d(0, 0, 0);
        -ms-transform: translate3d(0, 0, 0);
        -o-transform: translate3d(0, 0, 0);
        transform: translate3d(0, 0, 0);
        background: transparent
      }

      .btn-default:hover,
      .btn-default:active,
      .btn-default:focus {
        color: #fff !important
      }

      .btn-default:before {
        display: block;
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background: #232323;
        content: '';
        z-index: -2
      }

      .btn-default:after {
        display: block;
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background: #565656;
        content: '';
        z-index: -1;
        opacity: 0;
        -moz-transform: scaleX(0);
        -o-transform: scaleX(0);
        -webkit-transform: scaleX(0);
        transform: scaleX(0);
        -moz-transform-origin: 0 0;
        -o-transform-origin: 0 0;
        -webkit-transform-origin: 0 0;
        transform-origin: 0 0;
        -moz-transition: transform 0.4s cubic-bezier(.77, 0, .175, 1), opacity 0.05s linear 0.4s;
        -o-transition: transform 0.4s cubic-bezier(.77, 0, .175, 1), opacity 0.05s linear 0.4s;
        -webkit-transition: transform 0.4s cubic-bezier(.77, 0, .175, 1), opacity 0.05s linear;
        -webkit-transition-delay: 0s, 0.4s;
        transition: transform 0.4s cubic-bezier(.77, 0, .175, 1), opacity 0.05s linear 0.4s
      }

      .btn-default:hover:after {
        width: 100%;
        opacity: 1;
        -moz-transform: scaleX(1);
        -o-transform: scaleX(1);
        -webkit-transform: scaleX(1);
        transform: scaleX(1);
        -moz-transition-delay: 0s;
        -o-transition-delay: 0s;
        -webkit-transition-delay: 0s;
        transition-delay: 0s
      }

