      /*OPTION PREMIUM SLIDE*/

      .premiumOption {
        background-color: #f8f8f8;
        position: relative;
        height: auto;
        width: 82%;
        border-radius: 55px;
        max-width: 520px;
      }

      .premiumOption .textslide {
        position: absolute;
        top: 59%;
        font-size: 10px !important;
        left: 23px;
      }

      .premiumOption .makeChoice {
        display: inline-block;
      }

      .premiumOption .makeChoice .line {
        position: absolute;
        background-color: #fff;
        border: 1px solid #c8c8c8;
        width: 50px;
        height: 15px;
        border-radius: 10px;
        top: 40%;
        transform: translateY(-50%);
        left: 23px;
      }

      .premiumOption .makeChoice .circle {
        position: absolute;
        background-color: #c8c8c8;
        width: 22px;
        height: 22px;
        border-radius: 50%;
        top: 40%;
        transform: translateY(-50%);
        cursor: pointer;
        left: 23px;
        box-shadow: 2px 0px 3px #c8c8c8;
      }

      .premiumOption .makeChoice .circle.activep {
        background-color: #fff600;
        animation-name: slidePremiumYes;
        animation-duration: 0.4s;
        animation-timing-function: ease;
        left: 50px;
        box-shadow: 2px 0px 3px #c8c8c8;
      }

      @keyframes slidePremiumYes {
        0% {
          left: 23px;
        }

        100% {
          left: 50px;
        }
      }

      .premiumOption .makeChoice .circle.desactivep {
        background-color: #c8c8c8;
        animation-name: slidePremiumNo;
        animation-duration: 0.4s;
        animation-timing-function: ease;
        left: 23px;
        box-shadow: 2px 0px 3px #c8c8c8;
      }

      @keyframes slidePremiumNo {
        0% {
          left: 50px;
        }

        100% {
          left: 23px;
        }
      }

      .premiumOption .text {
        position: relative;
        width: 65%;
        display: inline-block;
        left: 95px;
        padding: 10px 0;
      }

      .premiumOption .text>p {
        font-size: 16px;
        font-weight: 700;
        margin: 0;
      }

      .premiumOption .text p {
        margin: 0;
      }

      .premiumOption .text span {
        font-size: 12px;
      }

      @media screen and (max-width: 767px) {
        .premiumOption {
          width: 100%;
        }
