      div.ei_richrb {
        border: 1px solid #e2e2e2;
        border-radius: 0;
        padding: 10px;
        box-sizing: border-box
      }

      div.ei_richrb.ei_richrb_disabled:hover {
        border: 1px solid #e2e2e2
      }

      div.ei_richrb.ei_selected,
      div.ei_richrb.ei_selected:hover,
      div.ei_richrb:not(.ei_richrb_disabled):hover {
        background-color: #bad606;
        border: 1px solid #bad606
      }

      div.ei_richrb.ei_selected *,
      div.ei_richrb.ei_selected:hover *,
      div.ei_richrb:not(.ei_richrb_disabled):hover * {
        color: #000
      }

      div.ei_richrb.ei_selected .fiche *,
      div.ei_richrb.ei_selected:hover .fiche *,
      div.ei_richrb:not(.ei_richrb_disabled):hover .fiche * {
        color: #ff0
      }

      div.ei_richrb.ei_richrb_pos_right {
        padding-right: 25px
      }

      div.ei_richrb.ei_richrb_pos_left {
        padding-left: 25px
      }

      div.ei_richrb.ei_richrb_pos_top {
        padding-top: 20px
      }

      div.ei_richrb.ei_richrb_pos_bottom {
        padding-bottom: 20px
      }

      div.ei_richrb.err {
        border: 1px solid #f87879
      }

      div.ei_richrb.err:before {
        content: ""
      }

      div.ei_richrb.err:hover {
        border: 1px solid #f87879;
        background-color: #f87879
      }

      div.ei_richrb.err:hover * {
        color: #fff
      }

      div.ei_richrbgroup {
        background: none transparent;
        border-width: 0;
        border-radius: 0;
        box-shadow: none;
        box-sizing: border-box
      }

      div.ei_richrbgroup div.ei_richrb {
        background: none #fff;
        border-radius: 1px;
        border: 1px solid #e2e2e2
      }

      div.ei_richrbgroup div.ei_richrb.ei_selected,
      div.ei_richrbgroup div.ei_richrb.ei_selected:focus,
      div.ei_richrbgroup div.ei_richrb.ei_selected:hover,
      div.ei_richrbgroup div.ei_richrb:not(.ei_richrb_disabled):focus,
      div.ei_richrbgroup div.ei_richrb:not(.ei_richrb_disabled):hover {
        background-color: #bad606;
        border: 1px solid #bad606
      }

      div.ei_richrbgroup div.ei_richrb.ei_selected *,
      div.ei_richrbgroup div.ei_richrb.ei_selected:focus *,
      div.ei_richrbgroup div.ei_richrb.ei_selected:hover *,
      div.ei_richrbgroup div.ei_richrb:not(.ei_richrb_disabled):focus *,
      div.ei_richrbgroup div.ei_richrb:not(.ei_richrb_disabled):hover * {
        color: #000
      }

      div.ei_richrbgroup div.ei_richrb.ei_selected label,
      div.ei_richrbgroup div.ei_richrb.ei_selected:focus label,
      div.ei_richrbgroup div.ei_richrb.ei_selected:hover label,
      div.ei_richrbgroup div.ei_richrb:not(.ei_richrb_disabled):focus label,
      div.ei_richrbgroup div.ei_richrb:not(.ei_richrb_disabled):hover label {
        border-color: #fff
      }

      div.ei_richrbgroup div.ei_richrb.ei_selected {
        box-shadow: none
      }

      div.ei_richrbgroup div.ei_richrb.ei_selected * {
        color: #000
      }

      div.ei_richrbgroup div.ei_richrb.err {
        border: 1px solid #f87879
      }

      div.ei_richrbgroup div.ei_richrb.err:focus,
      div.ei_richrbgroup div.ei_richrb.err:hover {
        border: 1px solid #f87879;
        background-color: #f87879
      }

      div.ei_richrb_disabled *,
      div.ei_richrb_disabled label {
        color: #999
      }

      @media screen and (max-width:991px) {
        div.ei_richrbgroup {
          border: 0
        }

        div.ei_richrbgroup div.ei_richrb {
          float: left;
          border: 1px solid #e2e2e2
        }

        div.ei_richrbgroup div.ei_richrb.ei_selected {
          border: 1px solid #bad606
        }
      }

