      .loader {
        display: flex;
        justify-content: center;
        flex-grow: 2;
        position: fixed !important;
        top: 0 !important;
        right: 0 !important;
        bottom: 0 !important;
        left: 0 !important;
        z-index: 999999
      }

      .loader__load {
        align-self: center;
        width: 30px;
        height: 30px;
        animation: loading 3s linear infinite
      }

      .loader__load__inner {
        stroke-dashoffset: 0;
        stroke-dasharray: 300;
        stroke-width: 20;
        stroke-miterlimit: 10;
        stroke-linecap: round;
        fill: transparent;
        animation: loading-circle 2s linear infinite
      }

      @keyframes loading {
        0% {
          transform: rotate(0)
        }

        to {
          transform: rotate(1turn)
        }
      }

      @keyframes loading-circle {
        0% {
          stroke-dashoffset: 0
        }

