                      <div class="title__faq"><span class="title__faq__text">Comment déclarer un sinistre en cas d'arrêt de travail (Indemni+ et Monaprotect Budget) ?</span> <span aria-label="expand" class="title__faq__icon inbenta-km-icon"></span></div>
                    </div>
                    <div aria-hidden="true" class="inbenta-km__faq__body">
                      <div class="body__contents"><span class="body__contents__item">
                          <p><span style="color:rgb(51,51,51)">Si vous avez souscrit à l'assurance Indemni+ ou Monaprotect Budget, vous pouvez demander le versement d’une rente mensuelle en cas d’arrêt de travail de plus de 90 jours suite à un accident, une maladie ou un licenciement et suivre votre demande depuis l'Espace Client ou l'application mobile.</span></p>
