                  <div class="inbenta-km__faq">
                    <div tabindex="1" class="inbenta-km__faq__title">
                      <!----> <span class="title__icon"></span>
                      <div class="title__faq"><span class="title__faq__text">Comment changer le visuel de ma carte Monabanq ?</span> <span aria-label="expand" class="title__faq__icon inbenta-km-icon"></span></div>
                    </div>
                    <div aria-hidden="true" class="inbenta-km__faq__body">
                      <div class="body__contents"><span class="body__contents__item">
                          <p>Vous pouvez choisir le visuel de votre carte au moment de la souscription au compte.</p>
                          <p>Nous proposons :</p>
                          <ul>
                            <li>3 visuels de carte pour la carte Visa Classic (visuel vert, visuel rose ou visuel bleu standard),</li>
                            <li>2 visuels de carte pour la carte Visa Premier (visuel doré Monabanq ou visuel doré standard),</li>
                            <li>2 visuels de carte pour la carte Visa Platinum (visuel gris Monabanq ou visuel gris standard).</li>
                          </ul>
                          <p>Vous pouvez demander un changement de visuel de votre carte bancaire à tout moment en effectuant une demande par email depuis la messagerie client.</p>
                          <p><strong>Deux possibilités vous sont proposées (il suffira de préciser votre choix dans votre demande) :</strong><br>- le renouvellement à échéance : vous recevrez votre nouvelle carte bancaire à l'échéance de votre carte actuelle (cette opération est gratuite).<br>- le renouvellement anticipé de votre carte bancaire : vous recevrez votre nouvelle carte bancaire sous 10 jours (cette opération est facturée 10€ sauf avec Uniq+).</p>
                          <p>Dans tous les cas, votre code secret reste inchangé.</p>
                        </span></div>
                      <!---->
                      <!---->
                      <div class="body__rating">
                        <div class="inbenta-km__rating">
                          <div class="inbenta-km__rating__content">
                            <div class="content__phrase">Cette réponse vous a-t-elle été utile ?</div>
