                      <div class="title__faq"><span class="title__faq__text">Comment fonctionne la gestion pilotée de l’assurance vie Monabanq Vie Premium ?</span> <span aria-label="expand" class="title__faq__icon inbenta-km-icon"></span></div>
                    </div>
                    <div aria-hidden="true" class="inbenta-km__faq__body">
                      <div class="body__contents"><span class="body__contents__item">
                          <p>La gestion pilotée est un mode de gestion qui vous permet de confier votre épargne à Generali Wealth Solutions, dont l’objectif est de répondre aux besoins de nos clients, quelles que soient les conditions de marché :</p>
                          <p>• protection du capital investi et maîtrise des risques,</p>
                          <p>• générer des rendements réguliers et stables,</p>
                          <p>• proposer des allocations d’actifs en fonction du profil de risque,</p>
                          <p>• investir avec une approche responsable pour bénéficier de la dynamique de l’Investissement Socialement Responsable.</p>
                          <p>Pour en savoir plus, contactez un conseiller au 0 810 002 001 (0,06€/min + prix d'un appel).</p>
